        <div className="character">
            <img src={props.characterImageThumb} alt={"Profile of " + props.characterName}/>
            <h3>{props.chracterName}</h3>
            <hr/>
            <p>
                {props.actorName}<br/>
            </p>
        </div>
    )
}

export default Character
